import React from 'react';
import {NavLink} from 'react-router-dom';
import './Header.css';
import {RiChargingPileLine} from "react-icons/ri";
import Button from 'react-bootstrap/Button';
import ProtectedRoute from './ProtectedRoute';

const Header = (props) => {
    return (
        <nav>
            <div className='header-nav'>
                <div>
                    <RiChargingPileLine />
                </div>
                <div>
                    <NavLink to='/'><h1>Home</h1></NavLink>
                </div>
                <div>
                    <NavLink to='/VisitorView'><h1>Map</h1></NavLink>
                </div>
                <div>
            <ProtectedRoute isUserLogged={props.isUserLogged} path="/UserView" render={(props)=>
                <NavLink to='/UserView'><h1>UserView</h1></NavLink>}>
            </ProtectedRoute>
                </div>
                <div>
                    <NavLink to='/Login'><h1>Login</h1></NavLink>
                </div>
            </div>
        </nav>
    )
}

export default Header;

